INSERT INTO `t_project` (`id`, `parent_id`, `name`, `survey`, `setting`, `status`, `mode`, `priority`, `is_deleted`, `create_at`, `create_by`, `update_at`, `update_by`) VALUES ('RzsRh8', '0', '快速开始', '{\"id\":\"IsrtRE\",\"title\":\"了解卷王\",\"description\":\"<a href=\\\"https://surveyking.cn/\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\" style=\\\"font-size: 18px;\\\">点击查看官方文档</a>\",\"type\":\"Survey\",\"attribute\":{\"suffix\":\"您已完成本次问卷，感谢您的帮助与支持\",\"submitButton\":\"提交\",\"globalRule\":[]},\"children\":[{\"id\":\"179c\",\"title\":\"<p><span style=\\\"color: rgb(230, 0, 0);\\\">注意，卷王问卷系统的逻辑和设置是分开的，</span><strong style=\\\"color: rgb(230, 0, 0);\\\">点击题目显示题目设置</strong><span style=\\\"color: rgb(230, 0, 0);\\\">，</span><strong style=\\\"color: rgb(230, 0, 0);\\\">点击选项显示选项设置</strong><span style=\\\"color: rgb(230, 0, 0);\\\">！</span></p><p><br></p><p><span style=\\\"font-size: 18px;\\\">常见问题：</span></p><p><br></p><p><span style=\\\"font-size: 16px;\\\">1、 如何修改系统名称和开启用户注册</span></p><p>在<strong>系统管理-&gt;个人设置-&gt;系统设置</strong>里面可以修改当前系统名称和系统图标，开启用户注册，开启登录验证码</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">2、问题如何添加图片</span></p><p>图片直接复制粘贴即可，或者点击题目，高级设置，在弹窗里面上传图片，支持剪贴板复制粘贴图片。无论是问题、选项还是考试的答题解析都是支持富文本的（包含图片、视频、音频、数学公式等）</p><p><img src=\\\"data:image/png;base64,\\\" width=\\\"286\\\"></p><p><span style=\\\"font-size: 16px;\\\">3、如何开启投票</span></p><p>单选题和多选题的问题设置里面，打开<strong>显示投票结果</strong>开关即可</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">4、如何设置问卷关联</span></p><p>参考<a href=\\\"https://surveyking.cn/help/field-form/form-association\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">问卷关联设置</a>，可以在一个问卷里面引用其他问卷的答案</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">5、首页我的问卷里面如何才能显示问卷信息</span></p><p>打开系统设置，回收设置，添加<strong>系统用户白名单</strong></p><p><br></p><p><span style=\\\"font-size: 16px;\\\">6、如何创建公开查询（</span><span style=\\\"font-size: 16px; color: rgb(0, 102, 204);\\\">类似易查分和金山快查</span><span style=\\\"font-size: 16px;\\\">）</span></p><p>打开系统设置，投放与分享，公开查询设置，新建查询页面</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">7、如何快速入门公式</span></p><p>请参考<a href=\\\"https://hc.jiandaoyun.com/doc/9032\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">简单云-公式规则文档</a> 和 卷王的<a href=\\\"https://surveyking.cn/help/logic/formula\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">公式文档</a>(使用方式和原理基本一样)，目前卷王支持显示逻辑、结束逻辑、跳转逻辑、计算逻辑、校验逻辑、答卷完自定义提示语逻辑、文本替换逻辑，理论上支持比问卷星强大的多的逻辑设置。</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">8、如何设置计算公式，比如根据身份证号计算年龄和性别</span></p><p>参考<a href=\\\"https://surveyking.cn/help/logic/calculate\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">计算逻辑文档</a></p><p><br></p><p><span style=\\\"font-size: 16px;\\\">9、如何设置题目的显示隐藏</span></p><p>参考<a href=\\\"https://surveyking.cn/docs/guides/logic/show\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">显示逻辑文档</a></p><p><br></p><p><span style=\\\"font-size: 16px;\\\">10、如果自定义答卷后的页面显示</span></p><p>打开系统设置，投放与分享，答题后自定义跳转页面</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">11、需要更多功能，提交一个 bug</span></p><p>如果您需要一个新的功能，或者在使用过程中发现了一个问题，可以通过这个链接 <a href=\\\"https://wj.surveyking.cn/s/start\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">https://wj.surveyking.cn/s/start</a> 来提交</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">12、系统商用免费吗？</span></p><p>无论公司还是个人，都可以免费使用，如果需要获取更强大的功能、更稳定的服务、二开定制等可以考虑购买我们的 Pro 版本，<a href=\\\"https://surveyking.cn\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">进入官网</a> ，人工咨询即可。</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">13、如何修改系统名称和 logo？</span></p><p>「系统管理&gt;个人设置&gt;系统设置」里面可以修改系统名称、logo、开启是否登录、设置备案号等操作</p><p><br></p><p><span style=\\\"font-size: 16px;\\\">14、捐助作者</span></p><p><span style=\\\"font-size: 14px;\\\">坚持不易，如果对您有帮助，可以捐助作者或者在 </span><a href=\\\"https://gitee.com/surveyking/surveyking\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\" style=\\\"font-size: 14px;\\\">https://gitee.com/surveyking/surveyking&nbsp;</a><span style=\\\"font-size: 14px;\\\">给一个 star，非常感谢 🙏。</span></p><p><br></p><p><span style=\\\"font-size: 16px;\\\">15、免责声明</span></p><p><a href=\\\"https://surveyking.cn/help/disclaimer\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">点击查看</a></p>\",\"type\":\"Remark\",\"attribute\":{}}]}', '{\"status\":1,\"answerSetting\":{\"progressBar\":true,\"questionNumber\":true,\"autoSave\":false,\"whitelistType\":3,\"triggerType\":\"onBlur\"},\"submittedSetting\":{},\"examSetting\":{}}', 1, 'survey', 1000, 0, '2022-11-07 15:13:20', '1457995481966747649', '2024-08-14 20:01:01', '1457995481966747649');
