INSERT INTO `t_project` (`id`, `parent_id`, `name`, `survey`, `setting`, `status`, `mode`, `priority`, `is_deleted`, `create_at`, `create_by`, `update_at`, `update_by`) VALUES ('g5GacM', '0', '考试功能演示', '{\"id\":\"g8YKtO\",\"title\":\"科目1考试\",\"description\":\"抽题可以有两种模式：固定题库抽题和随机抽题\",\"type\":\"Survey\",\"attribute\":{\"suffix\":\"您已完成本次考试。\",\"submitButton\":\"提交\",\"examScore\":100.0,\"globalRule\":[]},\"children\":[{\"id\":\"1821712519335702537\",\"title\":\"驾驶人在超车时， 前方车辆不减速 、不让道， 应怎样做？ 单选题\",\"type\":\"Radio\",\"attribute\":{\"examScore\":10.0,\"examAnswerMode\":\"onlyOne\"},\"children\":[{\"id\":\"MPFf\",\"title\":\"a.加速继续超越\",\"attribute\":{}},{\"id\":\"5MLj\",\"title\":\"b.连续鸣喇叭加速超越\",\"attribute\":{}},{\"id\":\"3HNy\",\"title\":\"c.主动礼让， 确保行车安全\",\"attribute\":{}},{\"id\":\"kC4Q\",\"title\":\"d.挤靠“加塞”车辆， 逼其离开 答案： c\",\"attribute\":{\"examCorrectAnswer\":\"kC4Q\"}}],\"tags\":[\"科目一\"]},{\"id\":\"1821712519335702533\",\"title\":\"这个开关控制机动车哪个部位？ 单选题\",\"type\":\"Radio\",\"attribute\":{\"examScore\":10.0,\"examAnswerMode\":\"onlyOne\"},\"children\":[{\"id\":\"s7MQ\",\"title\":\"a.风窗玻璃除雾器\",\"attribute\":{}},{\"id\":\"oRQr\",\"title\":\"b.风窗玻璃刮水器\",\"attribute\":{}},{\"id\":\"ObB8\",\"title\":\"c.危险报警闪光灯\",\"attribute\":{\"examCorrectAnswer\":\"ObB8\"}},{\"id\":\"PEtd\",\"title\":\"d.照明 、信号装置\",\"attribute\":{}}],\"tags\":[\"科目一\"]},{\"id\":\"1821712519335702534\",\"title\":\"机动车仪表板上（如图所示） 亮表示什么？ 单选题\",\"description\":\"<img src=\\\"data:image/png;base64,\\\" width=\\\"89\\\">\",\"type\":\"Radio\",\"attribute\":{\"examScore\":10.0,\"examAnswerMode\":\"onlyOne\"},\"children\":[{\"id\":\"Himw\",\"title\":\"a.前照灯开启\",\"attribute\":{}},{\"id\":\"c36b\",\"title\":\"b.危险报警闪光灯开启\",\"attribute\":{\"examCorrectAnswer\":\"c36b\"}},{\"id\":\"rsjf\",\"title\":\"c.前后位置灯开启\",\"attribute\":{}},{\"id\":\"AGMU\",\"title\":\"d.前后雾灯开启\",\"attribute\":{}}],\"tags\":[\"科目一\"]},{\"id\":\"1821712519335702532\",\"title\":\"这个标志是何含义？ 单选题\",\"type\":\"Radio\",\"attribute\":{\"examScore\":1